/**
*<div id="intlchar.hasbinaryproperty" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::hasBinaryProperty</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::hasBinaryProperty</span> &mdash; <span class="dc-title">Check a binary Unicode property for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.hasbinaryproperty-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::hasBinaryProperty</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Checks a binary Unicode property for a code point.  </p>  <p class="para">   Unicode, especially in version 3.2, defines many more properties than the original set in UnicodeData.txt.  </p>  <p class="para">   The properties APIs are intended to reflect Unicode properties as defined in the Unicode Character Database (UCD)   and Unicode Technical Reports (UTR). For details about the properties see   <a href="http://www.unicode.org/ucd/" class="link external">&raquo;&nbsp;http://www.unicode.org/ucd/</a>.   For names of Unicode properties see the UCD file PropertyAliases.txt.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.hasbinaryproperty-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <p class="para">The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.hasbinaryproperty-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> or <strong><span>false</span></strong> according to the binary Unicode property value for <span class="parameter" style="color:#3A95FF">codepoint</span>.   Also <strong><span>false</span></strong> if <span class="parameter" style="color:#3A95FF">property</span> is out of bounds or if the Unicode version does not have data for   the property at all, or not for this code point. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.hasbinaryproperty-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_ALPHABETIC</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_CASE_SENSITIVE</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_MIRRORED</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"["</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_ALPHABETIC</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"["</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_CASE_SENSITIVE</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">hasBinaryProperty</span><span style="color: #007700">(</span><span style="color: #DD0000">"["</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_MIRRORED</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(false)<br>bool(false)<br>bool(false)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.hasbinaryproperty-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::getIntPropertyValue()} - Get the value for a Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getUnicodeVersion()} - Get the Unicode version</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE or FALSE according to the binary Unicode property value for codepoint.*/
    public static function hasBinaryProperty(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property
    ): ?bool {}

/**
*<div id="intlchar.charage" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charAge</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charAge</span> &mdash; <span class="dc-title">Get the &quot;age&quot; of the code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.charage-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charAge</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">array</span></span></div>  <p class="para rdfs-comment">   Gets the &quot;age&quot; of the code point.  </p>  <p class="para">   The &quot;age&quot; is the Unicode version when the code point was first designated (as a non-character or for Private Use)   or assigned a character. This can be useful to avoid emitting code points to receiving processes that do not accept   newer characters.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.charage-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.charage-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The Unicode version number, as an <span class="type" style="color:#EAB766">array</span>.   For example, version <em>1.3.31.2</em> would be represented as <span>[1, 3, 31, 2]</span>.   Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.charage-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charage</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charage</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{1F576}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>array(4) {<br>  [0]=&gt;<br>  int(1)<br>  [1]=&gt;<br>  int(1)<br>  [2]=&gt;<br>  int(0)<br>  [3]=&gt;<br>  int(0)<br>}<br>array(4) {<br>  [0]=&gt;<br>  int(7)<br>  [1]=&gt;<br>  int(0)<br>  [2]=&gt;<br>  int(0)<br>  [3]=&gt;<br>  int(0)<br>}<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.charage-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::getUnicodeVersion()} - Get the Unicode version</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyMinValue()} - Get the min value for a Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyValue()} - Get the value for a Unicode property for a code point</span></li>   </ul>  </span> </div></div>
     * @return array|null The Unicode version number, as an array. For example, version 1.3.31.2 would be represented as [1, 3, 31, 2].*/
    public static function charAge(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?array {}

/**
*<div id="intlchar.chardigitvalue" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charDigitValue</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charDigitValue</span> &mdash; <span class="dc-title">Get the decimal digit value of a decimal digit character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.chardigitvalue-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charDigitValue</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Returns the decimal digit value of a decimal digit character.  </p>  <p class="para">   Such characters have the general category &quot;Nd&quot; (decimal digit numbers) and a Numeric_Type of Decimal.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.chardigitvalue-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.chardigitvalue-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The decimal digit value of <span class="parameter" style="color:#3A95FF">codepoint</span>,   or <span>-1</span> if it is not a decimal digit character. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.chardigitvalue-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDigitValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDigitValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{0662}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDigitValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{0E53}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(1)<br>int(2)<br>int(3)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.chardigitvalue-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::getNumericValue()} - Get the numeric value for a Unicode code point</span></li>   </ul>  </span> </div></div>
     * @return int|null The decimal digit value of codepoint, or -1 if it is not a decimal digit character.*/
    public static function charDigitValue(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?int {}

/**
*<div id="intlchar.chardirection" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charDirection</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charDirection</span> &mdash; <span class="dc-title">Get bidirectional category value for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.chardirection-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charDirection</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Returns the bidirectional category value for the code point, which is used in the <a href="http://www.unicode.org/reports/tr9/" class="link external">&raquo;&nbsp;Unicode bidirectional algorithm (UAX #9)</a>.  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    Some unassigned code points have bidi values of R or AL because they are in blocks that are reserved for Right-To-Left scripts.   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.chardirection-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.chardirection-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The bidirectional category value; one of the following constants:   <ul class="simplelist">    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_LEFT_TO_RIGHT</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_RIGHT_TO_LEFT</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_EUROPEAN_NUMBER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_EUROPEAN_NUMBER_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_EUROPEAN_NUMBER_TERMINATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_ARABIC_NUMBER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_COMMON_NUMBER_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_BLOCK_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_SEGMENT_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_WHITE_SPACE_NEUTRAL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_OTHER_NEUTRAL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_LEFT_TO_RIGHT_EMBEDDING</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_LEFT_TO_RIGHT_OVERRIDE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_RIGHT_TO_LEFT_ARABIC</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_RIGHT_TO_LEFT_EMBEDDING</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_RIGHT_TO_LEFT_OVERRIDE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_POP_DIRECTIONAL_FORMAT</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_DIR_NON_SPACING_MARK</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_BOUNDARY_NEUTRAL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_FIRST_STRONG_ISOLATE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_LEFT_TO_RIGHT_ISOLATE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_RIGHT_TO_LEFT_ISOLATE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_POP_DIRECTIONAL_ISOLATE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_DIRECTION_CHAR_DIRECTION_COUNT</span></strong></li>   </ul>   Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.chardirection-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDirection</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_DIRECTION_LEFT_TO_RIGHT</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDirection</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{05E9}"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_DIRECTION_RIGHT_TO_LEFT</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDirection</span><span style="color: #007700">(</span><span style="color: #DD0000">"+"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_DIRECTION_EUROPEAN_NUMBER_SEPARATOR</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charDirection</span><span style="color: #007700">(</span><span style="color: #DD0000">"."</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_DIRECTION_COMMON_NUMBER_SEPARATOR</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div></div>
     * @return int|null <p>The bidirectional category value; one of the following constants:*/
    public static function charDirection(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?int {}

/**
*<div id="intlchar.charfromname" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charFromName</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charFromName</span> &mdash; <span class="dc-title">Find Unicode character by name and return its code point value</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.charfromname-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charFromName</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#3A95FF">$name</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$type</span><span class="initializer"> = IntlChar::UNICODE_CHAR_NAME</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Finds a Unicode character by its name and returns its code point value.  </p>  <p class="para">   The name is matched exactly and completely. If the name does not correspond to a code point, <strong><span>null</span></strong> is returned.  </p>  <p class="para">   A Unicode 1.0 name is matched only if it differs from the modern name. Unicode names are all uppercase.   Extended names are lowercase followed by an uppercase hexadecimal number, and within angle brackets.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.charfromname-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">name</span></dt>    <dd>     <span>      Full name of the Unicode character.     </span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">type</span></dt>    <dd>     <p class="para">      Which set of names to use for the lookup. Can be any of these constants:      <ul class="simplelist">       <li class="member"><strong><span>IntlChar::UNICODE_CHAR_NAME</span></strong> (default)</li>       <li class="member"><strong><span>IntlChar::UNICODE_10_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::EXTENDED_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_ALIAS</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_CHOICE_COUNT</span></strong></li>      </ul>     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.charfromname-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The Unicode value of the code point with the given name (as an <span class="type" style="color:#EAB766">int</span>), or <strong><span>null</span></strong> if there is no such code point.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.charfromname-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charFromName</span><span style="color: #007700">(</span><span style="color: #DD0000">"LATIN CAPITAL LETTER A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charFromName</span><span style="color: #007700">(</span><span style="color: #DD0000">"SNOWMAN"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charFromName</span><span style="color: #007700">(</span><span style="color: #DD0000">"RECYCLING SYMBOL FOR TYPE-1 PLASTICS"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charFromName</span><span style="color: #007700">(</span><span style="color: #DD0000">"A RANDOM STRING WHICH DOESN'T CORRESPOND TO ANY UNICODE CHARACTER"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(65)<br>int(9731)<br>int(9843)<br>NULL<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.charfromname-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::charName()} - Retrieve the name of a Unicode character</span></li>    <li class="member"><span class="function">{@link IntlChar::enumCharNames()} - Enumerate all assigned Unicode characters within a range</span></li>   </ul>  </span> </div></div>
     * @return int|null The Unicode value of the code point with the given name (as an integer), or NULL if there is no such code point.*/
    public static function charFromName(
        #[LanguageLevelTypeAware(['8.0' => 'string'], default: '')] $name,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $type = IntlChar::UNICODE_CHAR_NAME
    ): ?int {}

/**
*<div id="intlchar.charmirror" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charMirror</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charMirror</span> &mdash; <span class="dc-title">Get the &quot;mirror-image&quot; character for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.charmirror-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charMirror</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766">null</span></span></div>  <p class="para rdfs-comment">   Maps the specified character to a &quot;mirror-image&quot; character.  </p>  <p class="para">   For characters with the <em>Bidi_Mirrored</em> property, implementations sometimes need a &quot;poor man&#039;s&quot; mapping to another   Unicode character (code point) such that the default glyph may serve as the mirror-image of the default glyph of the   specified character. This is useful for text conversion to and from codepages with visual order, and for displays   without glyph selection capabilities.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.charmirror-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.charmirror-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns another Unicode code point that may serve as a mirror-image substitute, or <span class="parameter" style="color:#3A95FF">codepoint</span>   itself if there is no such mapping or <span class="parameter" style="color:#3A95FF">codepoint</span> does not have the   <em>Bidi_Mirrored</em> property.  </p>  <p class="para">返回类型是 <span class="type" style="color:#EAB766">int</span>，如果代码点作为 UTF-8 <span class="type" style="color:#EAB766">string</span> 传递，则会返回 <span class="type" style="color:#EAB766">string</span> 。失败时返回 <strong><span>null</span></strong>。</p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.charmirror-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charMirror</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charMirror</span><span style="color: #007700">(</span><span style="color: #DD0000">"&lt;"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charMirror</span><span style="color: #007700">(</span><span style="color: #DD0000">"("</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(1) &quot;A&quot;<br>string(1) &quot;&gt;&quot;<br>string(2) &quot;)&quot;<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.charmirror-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isMirrored()} - Check if code point has the Bidi_Mirrored property</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_BIDI_MIRRORED</span></strong></li>   </ul>  </span> </div></div>
     * @return int|string|null Returns another Unicode code point that may serve as a mirror-image substitute, or codepoint itself if there is no such mapping or codepoint does not have the Bidi_Mirrored property.*/
    public static function charMirror(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): string|int|null {}

/**
*<div id="intlchar.charname" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charName</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charName</span> &mdash; <span class="dc-title">Retrieve the name of a Unicode character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.charname-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charName</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$type</span><span class="initializer"> = IntlChar::UNICODE_CHAR_NAME</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">string</span></span></div>  <p class="para rdfs-comment">   Retrieves the name of a Unicode character.  </p>  <p class="para">   Depending on <span class="parameter" style="color:#3A95FF">type</span>, the resulting character name is the &quot;modern&quot; name or the name that   was defined in Unicode version 1.0. The name contains only &quot;invariant&quot; characters like A-Z, 0-9, space, and &#039;-&#039;.   Unicode 1.0 names are only retrieved if they are different from the modern names and if ICU contains the data for them.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.charname-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">type</span></dt>    <dd>     <p class="para">      Which set of names to use for the lookup. Can be any of these constants:      <ul class="simplelist">       <li class="member"><strong><span>IntlChar::UNICODE_CHAR_NAME</span></strong> (default)</li>       <li class="member"><strong><span>IntlChar::UNICODE_10_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::EXTENDED_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_ALIAS</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_CHOICE_COUNT</span></strong></li>      </ul>     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.charname-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The corresponding name, or an empty string if there is no name for this character,   or <strong><span>null</span></strong> if there is no such code point.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.charname-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charName</span><span style="color: #007700">(</span><span style="color: #DD0000">"."</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charName</span><span style="color: #007700">(</span><span style="color: #DD0000">"."</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">UNICODE_CHAR_NAME</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charName</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charName</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{0000}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(9) &quot;FULL STOP&quot;<br>string(9) &quot;FULL STOP&quot;<br>string(7) &quot;SNOWMAN&quot;<br>string(0) &quot;&quot;<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.charname-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::charFromName()} - Find Unicode character by name and return its code point value</span></li>    <li class="member"><span class="function">{@link IntlChar::enumCharNames()} - Enumerate all assigned Unicode characters within a range</span></li>   </ul>  </span> </div></div>
     * @return string|null The corresponding name, or an empty string if there is no name for this character, or NULL if <em>codepoint</em> is out of bounds.*/
    public static function charName(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $type = IntlChar::UNICODE_CHAR_NAME
    ): ?string {}

/**
*<div id="intlchar.chartype" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::charType</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::charType</span> &mdash; <span class="dc-title">Get the general category value for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.chartype-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::charType</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Returns the general category value for the code point.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.chartype-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.chartype-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the general category type, which may be one of the following constants:   <ul class="simplelist">    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_UNASSIGNED</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_GENERAL_OTHER_TYPES</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_UPPERCASE_LETTER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_LOWERCASE_LETTER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_TITLECASE_LETTER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_MODIFIER_LETTER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_OTHER_LETTER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_NON_SPACING_MARK</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_ENCLOSING_MARK</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_COMBINING_SPACING_MARK</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_DECIMAL_DIGIT_NUMBER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_LETTER_NUMBER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_OTHER_NUMBER</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_SPACE_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_LINE_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_PARAGRAPH_SEPARATOR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_CONTROL_CHAR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_FORMAT_CHAR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_PRIVATE_USE_CHAR</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_SURROGATE</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_DASH_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_START_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_END_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_CONNECTOR_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_OTHER_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_MATH_SYMBOL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_CURRENCY_SYMBOL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_MODIFIER_SYMBOL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_OTHER_SYMBOL</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_INITIAL_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_FINAL_PUNCTUATION</span></strong></li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_CHAR_CATEGORY_COUNT</span></strong></li>   </ul>  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.chartype-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charType</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_CATEGORY_UPPERCASE_LETTER</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charType</span><span style="color: #007700">(</span><span style="color: #DD0000">"."</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_CATEGORY_OTHER_PUNCTUATION</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charType</span><span style="color: #007700">(</span><span style="color: #DD0000">"\t"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_CATEGORY_CONTROL_CHAR</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charType</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_CATEGORY_OTHER_SYMBOL</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">charType</span><span style="color: #007700">(</span><span style="color: #DD0000">"multiple chars"</span><span style="color: #007700">) === </span><span style="color: #9876AA">null</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div></div>
     * @return int|null Returns the general category type, which may be one of the following constants:*/
    public static function charType(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?int {}

/**
*<div id="intlchar.chr" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::chr</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::chr</span> &mdash; <span class="dc-title">Return Unicode character by code point value</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.chr-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::chr</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">string</span></span></div>  <p class="para rdfs-comment">   Returns a string containing the character specified by the Unicode code point value.  </p>  <p class="para">   This function complements <span class="function">{@link IntlChar::ord()}</span>.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.chr-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.chr-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   A string containing the single character specified by the Unicode code point value, or <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.chr-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />$values </span><span style="color: #007700">= [</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">63</span><span style="color: #007700">, </span><span style="color: #9876AA">123</span><span style="color: #007700">, </span><span style="color: #9876AA">9731</span><span style="color: #007700">];<br />foreach (</span><span style="color: #9876AA">$values </span><span style="color: #007700">as </span><span style="color: #9876AA">$value</span><span style="color: #007700">) {<br />    </span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">chr</span><span style="color: #007700">(</span><span style="color: #9876AA">$value</span><span style="color: #007700">));<br />}<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(1) &quot;A&quot;<br>string(1) &quot;?&quot;<br>string(1) &quot;{&quot;<br>string(3) &quot;☃&quot;<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.chr-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::ord()} - Return Unicode code point value of character</span></li>    <li class="member"><span class="function">{@link mb_chr()} - 按 Unicode 码位值返回字符</span></li>    <li class="member"><span class="function">{@link chr()} - 从数字生成单字节字符串</span></li>   </ul>  </span> </div></div>
     * @return string|null A string containing the single character specified by the Unicode code point value.*/
    public static function chr(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?string {}

/**
*<div id="intlchar.digit" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::digit</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::digit</span> &mdash; <span class="dc-title">Get the decimal digit value of a code point for a given radix</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.digit-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::digit</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$base</span><span class="initializer"> = 10</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766"><span class="type false" style="color:#EAB766">false</span></span>|<span class="type" style="color:#EAB766">null</span></span></div>  <p class="para rdfs-comment">   Returns the decimal digit value of the code point in the specified radix.  </p>  <p class="para">   If the radix is not in the range <span>2&lt;=radix&lt;=36</span> or if the value of <span class="parameter" style="color:#3A95FF">codepoint</span>   is not a valid digit in the specified radix, <strong><span>false</span></strong> is returned.   A character is a valid digit if at least one of the following is true:   <ul class="simplelist">    <li class="member">The character has a decimal digit value. Such characters have the general category &quot;Nd&quot; (decimal digit numbers) and a Numeric_Type of Decimal. In this case the value is the character&#039;s decimal digit value.</li>    <li class="member">The character is one of the uppercase Latin letters &#039;A&#039; through &#039;Z&#039;. In this case the value is c-&#039;A&#039;+10.</li>    <li class="member">The character is one of the lowercase Latin letters &#039;a&#039; through &#039;z&#039;. In this case the value is ch-&#039;a&#039;+10.</li>    <li class="member">Latin letters from both the ASCII range (0061..007A, 0041..005A) as well as from the Fullwidth ASCII range (FF41..FF5A, FF21..FF3A) are recognized.</li>   </ul>  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.digit-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">base</span></dt>    <dd>     <p class="para">      The radix (defaults to <span>10</span>).     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.digit-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the numeric value represented by the character in the specified radix,   or <strong><span>false</span></strong> if there is no value or if the value exceeds the radix. Returns <strong><span>null</span></strong> on failure.  </p>  <div class="warning"><strong class="warning">警告</strong><p class="simpara">此函数可能返回布尔值<strong><span>false</span></strong>，但也可能返回等同于 <strong><span>false</span></strong> 的非布尔值。请阅读 <a href="https://www.php.net/manual/zh/language.types.boolean.php" class="link">布尔类型</a>章节以获取更多信息。应使用<a href="https://www.php.net/manual/zh/language.operators.comparison.php" class="link">===运算符</a>来测试此函数的返回值。</p></div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.digit-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">digit</span><span style="color: #007700">(</span><span style="color: #DD0000">"0"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">digit</span><span style="color: #007700">(</span><span style="color: #DD0000">"3"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">digit</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">digit</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">16</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(0)<br>int(3)<br>bool(false)<br>int(10)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.digit-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::forDigit()} - Get character representation for a given digit and radix</span></li>    <li class="member"><span class="function">{@link IntlChar::charDigitValue()} - Get the decimal digit value of a decimal digit character</span></li>    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_NUMERIC_TYPE</span></strong></li>   </ul>  </span> </div></div>
     * @return int|false|null Returns the numeric value represented by the character in the specified radix,*/
    public static function digit(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $base = 10
    ): int|false|null {}

/**
*<div id="intlchar.enumcharnames" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::enumCharNames</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::enumCharNames</span> &mdash; <span class="dc-title">Enumerate all assigned Unicode characters within a range</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.enumcharnames-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::enumCharNames</strong></span>(<br>&nbsp;&nbsp;&nbsp;&nbsp;<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$start</span></span>,<br>&nbsp;&nbsp;&nbsp;&nbsp;<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$end</span></span>,<br>&nbsp;&nbsp;&nbsp;&nbsp;<span class="methodparam"><span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.callable.php" class="type callable" style="color:#EAB766">callable</a></span> <span class="parameter" style="color:#3A95FF">$callback</span></span>,<br>&nbsp;&nbsp;&nbsp;&nbsp;<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$type</span><span class="initializer"> = IntlChar::UNICODE_CHAR_NAME</span></span><br>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Enumerate all assigned Unicode characters between the start and limit code points (start inclusive, limit exclusive)   and call a function for each, passing the code point value and the character name.  </p>  <p class="para">   For Unicode 1.0 names, only those are enumerated that differ from the modern names.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.enumcharnames-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">start</span></dt>    <dd>     <span>      The first code point in the enumeration range.     </span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">end</span></dt>    <dd>     <p class="para">      One more than the last code point in the enumeration range (the first one after the range).     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">callback</span></dt>    <dd>     <p class="para">      The function that is to be called for each character name.  The following three arguments will be passed into it:      <ul class="simplelist">       <li class="member"><span class="type" style="color:#EAB766">int</span> <span>$codepoint</span> - The numeric code point value</li>       <li class="member"><span class="type" style="color:#EAB766">int</span> <span>$nameChoice</span> - The same value as the <span class="parameter" style="color:#3A95FF">type</span> parameter below</li>       <li class="member"><span class="type" style="color:#EAB766">string</span> <span>$name</span> - The name of the character</li>      </ul>     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">type</span></dt>    <dd>     <p class="para">      Selector for which kind of names to enumerate.  Can be any of these constants:      <ul class="simplelist">       <li class="member"><strong><span>IntlChar::UNICODE_CHAR_NAME</span></strong> (default)</li>       <li class="member"><strong><span>IntlChar::UNICODE_10_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::EXTENDED_CHAR_NAME</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_ALIAS</span></strong></li>       <li class="member"><strong><span>IntlChar::CHAR_NAME_CHOICE_COUNT</span></strong></li>      </ul>     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.enumcharnames-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   成功时返回 <strong><span>null</span></strong>， 或者在失败时返回 <strong><span>false</span></strong>。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.enumcharnames-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Enumerating over a sample range of code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">enumCharNames</span><span style="color: #007700">(</span><span style="color: #9876AA">0x2600</span><span style="color: #007700">, </span><span style="color: #9876AA">0x2610</span><span style="color: #007700">, function(</span><span style="color: #9876AA">$codepoint</span><span style="color: #007700">, </span><span style="color: #9876AA">$nameChoice</span><span style="color: #007700">, </span><span style="color: #9876AA">$name</span><span style="color: #007700">) {<br />    </span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"U+%04x %s\n"</span><span style="color: #007700">, </span><span style="color: #9876AA">$codepoint</span><span style="color: #007700">, </span><span style="color: #9876AA">$name</span><span style="color: #007700">);<br />});<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>U+2600 BLACK SUN WITH RAYS<br>U+2601 CLOUD<br>U+2602 UMBRELLA<br>U+2603 SNOWMAN<br>U+2604 COMET<br>U+2605 BLACK STAR<br>U+2606 WHITE STAR<br>U+2607 LIGHTNING<br>U+2608 THUNDERSTORM<br>U+2609 SUN<br>U+260a ASCENDING NODE<br>U+260b DESCENDING NODE<br>U+260c CONJUNCTION<br>U+260d OPPOSITION<br>U+260e BLACK TELEPHONE<br>U+260f WHITE TELEPHONE<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.enumcharnames-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::charName()} - Retrieve the name of a Unicode character</span></li>    <li class="member"><span class="function">{@link IntlChar::charFromName()} - Find Unicode character by name and return its code point value</span></li>   </ul>  </span> </div></div>
*/
    public static function enumCharNames(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $start,
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $end,
        #[LanguageLevelTypeAware(['8.0' => 'callable'], default: '')] $callback,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $type = IntlChar::UNICODE_CHAR_NAME
    ) {}

/**
*<div id="intlchar.enumchartypes" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::enumCharTypes</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::enumCharTypes</span> &mdash; <span class="dc-title">Enumerate all code points with their Unicode general categories</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.enumchartypes-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::enumCharTypes</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><a href="https://www.php.net/manual/zh/language.types.callable.php" class="type callable" style="color:#EAB766">callable</a></span> <span class="parameter" style="color:#3A95FF">$callback</span></span>): <span class="type" style="color:#EAB766"><span class="type void" style="color:#EAB766">void</span></span></div>  <p class="para rdfs-comment">   Enumerates efficiently all code points with their Unicode general categories. This is useful for building data   structures, for enumerating all assigned code points, etc.  </p>  <p class="para">   For each contiguous range of code points with a given general category (&quot;character type&quot;), the   <span class="parameter" style="color:#3A95FF">callback</span> function is called. Adjacent ranges have different types. The Unicode Standard   guarantees that the numeric value of the type is 0..31.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.enumchartypes-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">callback</span></dt>    <dd>     <span>      The function that is to be called for each contiguous range of code points with the same general category.      The following three arguments will be passed into it:      <ul class="simplelist">       <li class="member"><span class="type" style="color:#EAB766">int</span> <span>$start</span> - The starting code point of the range</li>       <li class="member"><span class="type" style="color:#EAB766">int</span> <span>$end</span> - The ending code point of the range</li>       <li class="member"><span class="type" style="color:#EAB766">int</span> <span>$name</span> - The category type (one of the <span>IntlChar::CHAR_CATEGORY_*</span> constants)</li>      </ul>     </span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.enumchartypes-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   没有返回值。  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.enumchartypes-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Enumerating over a sample range of code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">enumCharTypes</span><span style="color: #007700">(function(</span><span style="color: #9876AA">$start</span><span style="color: #007700">, </span><span style="color: #9876AA">$end</span><span style="color: #007700">, </span><span style="color: #9876AA">$type</span><span style="color: #007700">) {<br />    </span><span style="color: #9876AA">printf</span><span style="color: #007700">(</span><span style="color: #DD0000">"U+%04x through U+%04x are in category %d\n"</span><span style="color: #007700">, </span><span style="color: #9876AA">$start</span><span style="color: #007700">, </span><span style="color: #9876AA">$end</span><span style="color: #007700">, </span><span style="color: #9876AA">$type</span><span style="color: #007700">);<br />});<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>U+0000 through U+0020 are in category 15<br>U+0020 through U+0021 are in category 12<br>U+0021 through U+0024 are in category 23<br>U+0024 through U+0025 are in category 25<br>U+0025 through U+0028 are in category 23<br>U+0028 through U+0029 are in category 20<br>U+0029 through U+002a are in category 21<br>U+002a through U+002b are in category 23<br>U+002b through U+002c are in category 24<br>U+002c through U+002d are in category 23<br>U+002d through U+002e are in category 19<br>U+002e through U+0030 are in category 23<br>U+0030 through U+003a are in category 9<br>...<br></span></div>   </div>  </div> </div></div>
*/
    public static function enumCharTypes(
        #[PhpStormStubsElementAvailable(from: '7.0', to: '7.4')] $callback = null,
        #[PhpStormStubsElementAvailable(from: '8.0')] callable $callback
    ): void {}

/**
*<div id="intlchar.foldcase" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::foldCase</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::foldCase</span> &mdash; <span class="dc-title">Perform case folding on a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.foldcase-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::foldCase</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$options</span><span class="initializer"> = IntlChar::FOLD_CASE_DEFAULT</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766">null</span></span></div>  <p class="para rdfs-comment">   The given character is mapped to its case folding equivalent; if the character has no case folding equivalent,   the character itself is returned.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.foldcase-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">options</span></dt>    <dd>     <p class="para">      Either <strong><span>IntlChar::FOLD_CASE_DEFAULT</span></strong> (default)      or <strong><span>IntlChar::FOLD_CASE_EXCLUDE_SPECIAL_I</span></strong>.     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.foldcase-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the <em>Simple_Case_Folding</em> of the code point, if any; otherwise the code point itself on success,   or <strong><span>null</span></strong> on failure.  </p> </div></div>
     * @return int|string|null Returns the Simple_Case_Folding of the code point, if any; otherwise the code point itself.*/
    public static function foldCase(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $options = IntlChar::FOLD_CASE_DEFAULT
    ): string|int|null {}

/**
*<div id="intlchar.fordigit" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::forDigit</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::forDigit</span> &mdash; <span class="dc-title">Get character representation for a given digit and radix</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.fordigit-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::forDigit</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$digit</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$base</span><span class="initializer"> = 10</span></span>): <span class="type" style="color:#EAB766">int</span></div>  <p class="para rdfs-comment">   Determines the character representation for a specific digit in the specified radix.  </p>  <p class="para">   If the value of radix is not a valid radix, or the value of digit is not a valid digit in the specified radix,   the null character (<span>U+0000</span>) is returned.  </p>  <p class="para">   The radix argument is valid if it is greater than or equal to <span>2</span> and less than or equal to <span>36</span>.   The digit argument is valid if <span>0 &lt;= digit &lt; radix</span>.  </p>  <p class="para">   If the digit is less than <span>10</span>, then &#039;0&#039; + digit is returned. Otherwise, the value &#039;a&#039; + digit - 10 is returned.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.fordigit-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">digit</span></dt>    <dd>     <span>      The number to convert to a character.     </span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">base</span></dt>    <dd>     <p class="para">      The radix (defaults to <span>10</span>).     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.fordigit-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The character representation (as a <span class="type" style="color:#EAB766">string</span>) of the specified digit in the specified radix.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.fordigit-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">forDigit</span><span style="color: #007700">(</span><span style="color: #9876AA">0</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">forDigit</span><span style="color: #007700">(</span><span style="color: #9876AA">3</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">forDigit</span><span style="color: #007700">(</span><span style="color: #9876AA">3</span><span style="color: #007700">, </span><span style="color: #9876AA">10</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">forDigit</span><span style="color: #007700">(</span><span style="color: #9876AA">10</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">forDigit</span><span style="color: #007700">(</span><span style="color: #9876AA">10</span><span style="color: #007700">, </span><span style="color: #9876AA">16</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(48)<br>int(51)<br>int(51)<br>int(0)<br>int(97)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.fordigit-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::digit()} - Get the decimal digit value of a code point for a given radix</span></li>    <li class="member"><span class="function">{@link IntlChar::charDigitValue()} - Get the decimal digit value of a decimal digit character</span></li>    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_NUMERIC_TYPE</span></strong></li>   </ul>  </span> </div></div>
     * @return int The character representation (as a string) of the specified digit in the specified radix.*/
    public static function forDigit(
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $digit,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $base = 10
    ): int {}

/**
*<div id="intlchar.getbidipairedbracket" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getBidiPairedBracket</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getBidiPairedBracket</span> &mdash; <span class="dc-title">Get the paired bracket character for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getbidipairedbracket-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getBidiPairedBracket</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766">null</span></span></div>  <p class="para rdfs-comment">   Maps the specified character to its paired bracket character.  </p>  <p class="para">   For <span>Bidi_Paired_Bracket_Type!=None</span>, this is the same as <span class="function">{@link IntlChar::charMirror()}</span>.   Otherwise <span class="parameter" style="color:#3A95FF">codepoint</span> itself is returned.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getbidipairedbracket-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getbidipairedbracket-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the paired bracket code point, or <span class="parameter" style="color:#3A95FF">codepoint</span> itself if there is no such mapping. Returns   <strong><span>null</span></strong> on failure.  </p>  <p class="para">返回类型是 <span class="type" style="color:#EAB766">int</span>，如果代码点作为 UTF-8 <span class="type" style="color:#EAB766">string</span> 传递，则会返回 <span class="type" style="color:#EAB766">string</span> 。失败时返回 <strong><span>null</span></strong>。</p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getbidipairedbracket-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getBidiPairedBracket</span><span style="color: #007700">(</span><span style="color: #9876AA">91</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getBidiPairedBracket</span><span style="color: #007700">(</span><span style="color: #DD0000">'['</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(93)<br>string(1) &quot;]&quot;<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getbidipairedbracket-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::charMirror()} - Get the &quot;mirror-image&quot; character for a code point</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_BIDI_PAIRED_BRACKET</span></strong></li>    <li class="member"><strong><span>IntlChar::PROPERTY_BIDI_PAIRED_BRACKET_TYPE</span></strong></li>   </ul>  </span> </div></div>
     * @return int|string|null  Returns the paired bracket code point, or <em>codepoint</em> itself if there is no such mapping.*/
    public static function getBidiPairedBracket(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): string|int|null {}

/**
*<div id="intlchar.getblockcode" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getBlockCode</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getBlockCode</span> &mdash; <span class="dc-title">Get the Unicode allocation block containing a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getblockcode-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getBlockCode</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Returns the Unicode allocation block that contains the character.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getblockcode-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getblockcode-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the block value for <span class="parameter" style="color:#3A95FF">codepoint</span>.   See the <span>IntlChar::BLOCK_CODE_*</span> constants for possible return values. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getblockcode-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getBlockCode</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_BASIC_LATIN</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getBlockCode</span><span style="color: #007700">(</span><span style="color: #DD0000">"Φ"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getBlockCode</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_MISCELLANEOUS_SYMBOLS</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div></div>
     * @return int|null Returns the block value for <em>codepoint</em>, or NULL if <em>codepoint</em> is out of bound.*/
    public static function getBlockCode(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?int {}

