    public static function getCombiningClass(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?int {}

/**
*<div id="intlchar.getfc-nfkc-closure" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getFC_NFKC_Closure</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getFC_NFKC_Closure</span> &mdash; <span class="dc-title">Get the FC_NFKC_Closure property for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getfc-nfkc-closure-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getFC_NFKC_Closure</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766"><span class="type false" style="color:#EAB766">false</span></span>|<span class="type" style="color:#EAB766">null</span></span></div>  <p class="para rdfs-comment">   Gets the FC_NFKC_Closure property string for a character.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getfc-nfkc-closure-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getfc-nfkc-closure-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the FC_NFKC_Closure property string for the <span class="parameter" style="color:#3A95FF">codepoint</span>, or an empty string if there is none.   Returns <strong><span>null</span></strong> or <strong><span>false</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getfc-nfkc-closure-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getFC_NFKC_Closure</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2121}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getFC_NFKC_Closure</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{1D2D}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(3) &quot;tel&quot;<br>string(2) &quot;æ&quot;<br></span></div>   </div>  </div> </div></div>
     * @return string|false|null Returns the FC_NFKC_Closure property string for the codepoint, or an empty string if there is none,*/
    public static function getFC_NFKC_Closure(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): string|false|null {}

/**
*<div id="intlchar.getintpropertymaxvalue" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getIntPropertyMaxValue</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getIntPropertyMaxValue</span> &mdash; <span class="dc-title">Get the max value for a Unicode property</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getintpropertymaxvalue-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getIntPropertyMaxValue</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>): <span class="type" style="color:#EAB766">int</span></div>  <p class="para rdfs-comment">   Gets the maximum value for an enumerated/integer/binary Unicode property.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getintpropertymaxvalue-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <span>The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getintpropertymaxvalue-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The maximum value returned by <span class="function">{@link IntlChar::getIntPropertyValue()}</span> for a Unicode property.   <span>&lt;=0</span> if the property selector is out of range.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getintpropertymaxvalue-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMaxValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMaxValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_SCRIPT</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMaxValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_IDEOGRAPHIC</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMaxValue</span><span style="color: #007700">(</span><span style="color: #9876AA">999999999</span><span style="color: #007700">)); </span><span style="color: #FF8000">// Some made-up value<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(22)<br>int(166)<br>int(1)<br>int(-1)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getintpropertymaxvalue-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::hasBinaryProperty()} - Check a binary Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyMinValue()} - Get the min value for a Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyValue()} - Get the value for a Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getUnicodeVersion()} - Get the Unicode version</span></li>   </ul>  </span> </div></div>
     * @return int The maximum value returned by {@see IntlChar::getIntPropertyValue()} for a Unicode property. <=0 if the property selector is out of range.*/
    public static function getIntPropertyMaxValue(#[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property): int {}

/**
*<div id="intlchar.getintpropertyminvalue" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getIntPropertyMinValue</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getIntPropertyMinValue</span> &mdash; <span class="dc-title">Get the min value for a Unicode property</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getintpropertyminvalue-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getIntPropertyMinValue</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>): <span class="type" style="color:#EAB766">int</span></div>  <p class="para rdfs-comment">   Gets the minimum value for an enumerated/integer/binary Unicode property.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getintpropertyminvalue-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <span>The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getintpropertyminvalue-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   The minimum value returned by <span class="function">{@link IntlChar::getIntPropertyValue()}</span> for a Unicode property.   <span>0</span> if the property selector is out of range.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getintpropertyminvalue-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMinValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMinValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_SCRIPT</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMinValue</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_IDEOGRAPHIC</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyMinValue</span><span style="color: #007700">(</span><span style="color: #9876AA">999999999</span><span style="color: #007700">)); </span><span style="color: #FF8000">// Some made-up value<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>int(0)<br>int(0)<br>int(0)<br>int(0)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getintpropertyminvalue-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::hasBinaryProperty()} - Check a binary Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyMaxValue()} - Get the max value for a Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyValue()} - Get the value for a Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getUnicodeVersion()} - Get the Unicode version</span></li>   </ul>  </span> </div></div>
