    public static function getIntPropertyMinValue(#[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property): int {}

/**
*<div id="intlchar.getintpropertyvalue" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getIntPropertyValue</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getIntPropertyValue</span> &mdash; <span class="dc-title">Get the value for a Unicode property for a code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getintpropertyvalue-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getIntPropertyValue</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">int</span></span></div>  <p class="para rdfs-comment">   Gets the property value for an enumerated or integer Unicode property for a code point.   Also returns binary and mask property values.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getintpropertyvalue-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>          <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <p class="para">The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getintpropertyvalue-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the numeric value that is directly the property value or, for enumerated properties, corresponds to the   numeric value of the enumerated constant of the respective property value enumeration type. Returns <strong><span>null</span></strong> on failure.  </p>  <p class="para">   Returns <span>0</span> or <span>1</span> (for <strong><span>false</span></strong>/<strong><span>true</span></strong>) for binary Unicode properties.  </p>  <p class="para">   Returns a bit-mask for mask properties.  </p>  <p class="para">   Returns <span>0</span> if <span class="parameter" style="color:#3A95FF">property</span> is out of bounds or if the Unicode version does not   have data for the property at all, or not for this code point.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getintpropertyvalue-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_ALPHABETIC</span><span style="color: #007700">) === </span><span style="color: #9876AA">1</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"["</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_MIRRORED</span><span style="color: #007700">) === </span><span style="color: #9876AA">1</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getIntPropertyValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"Φ"</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getintpropertyvalue-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::hasBinaryProperty()} - Check a binary Unicode property for a code point</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyMinValue()} - Get the min value for a Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::getIntPropertyMaxValue()} - Get the max value for a Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::getUnicodeVersion()} - Get the Unicode version</span></li>   </ul>  </span> </div></div>
     * @return int|null <p>*/
    public static function getIntPropertyValue(
        #[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property
    ): ?int {}

/**
*<div id="intlchar.getnumericvalue" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getNumericValue</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getNumericValue</span> &mdash; <span class="dc-title">Get the numeric value for a Unicode code point</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getnumericvalue-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getNumericValue</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">float</span></span></div>  <p class="para rdfs-comment">   Gets the numeric value for a Unicode code point as defined in the Unicode Character Database.  </p>  <p class="para">   For characters without any numeric values in the Unicode Character Database, this function will return   <strong><span>IntlChar::NO_NUMERIC_VALUE</span></strong>.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getnumericvalue-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getnumericvalue-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Numeric value of <span class="parameter" style="color:#3A95FF">codepoint</span>,   or <strong><span>IntlChar::NO_NUMERIC_VALUE</span></strong> if none is defined. This   constant was added in PHP 7.0.6, prior to this version the literal value   (<span class="type" style="color:#EAB766">float</span>)<span>-123456789</span> may be used instead. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getnumericvalue-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getNumericValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"4"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getNumericValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"x"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getNumericValue</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{216C}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>float(4)<br>float(-123456789)<br>float(50)<br></span></div>   </div>  </div> </div></div>
     * @return float|null Numeric value of codepoint, or float(-123456789) if none is defined, or NULL if <em>codepoint</em> is out of bound.*/
    public static function getNumericValue(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?float {}

/**
*<div id="intlchar.getpropertyenum" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getPropertyEnum</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getPropertyEnum</span> &mdash; <span class="dc-title">Get the property constant value for a given property name</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getpropertyenum-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getPropertyEnum</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#3A95FF">$alias</span></span>): <span class="type" style="color:#EAB766">int</span></div>  <p class="para rdfs-comment">   Returns the property constant value for a given property name, as specified in the Unicode database file PropertyAliases.txt.   Short, long, and any other variants are recognized.  </p>  <p class="para">   In addition, this function maps the synthetic names &quot;gcm&quot; / &quot;General_Category_Mask&quot; to the property   <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY_MASK</span></strong>. These names are not in PropertyAliases.txt.  </p>  <p class="para">   This function complements <span class="function">{@link IntlChar::getPropertyName()}</span>.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getpropertyenum-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">alias</span></dt>    <dd>     <span>      The property name to be matched. The name is compared using &quot;loose matching&quot; as described in PropertyAliases.txt.     </span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getpropertyenum-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns an <span>IntlChar::PROPERTY_</span> constant value,   or <strong><span>IntlChar::PROPERTY_INVALID_CODE</span></strong> if the given name does not match any property.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getpropertyenum-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyEnum</span><span style="color: #007700">(</span><span style="color: #DD0000">'Bidi_Class'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyEnum</span><span style="color: #007700">(</span><span style="color: #DD0000">'script'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_SCRIPT</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyEnum</span><span style="color: #007700">(</span><span style="color: #DD0000">'IDEOGRAPHIC'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_IDEOGRAPHIC</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyEnum</span><span style="color: #007700">(</span><span style="color: #DD0000">'Some made-up string'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_INVALID_CODE</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getpropertyenum-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::getPropertyName()} - Get the Unicode name for a property</span></li>   </ul>  </span> </div></div>
     * @return int Returns an IntlChar::PROPERTY_ constant value, or <b>IntlChar::PROPERTY_INVALID_CODE</b> if the given name does not match any property.*/
    public static function getPropertyEnum(#[LanguageLevelTypeAware(['8.0' => 'string'], default: '')] $alias): int {}

/**
*<div id="intlchar.getpropertyname" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getPropertyName</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getPropertyName</span> &mdash; <span class="dc-title">Get the Unicode name for a property</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getpropertyname-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getPropertyName</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$type</span><span class="initializer"> = IntlChar::LONG_PROPERTY_NAME</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766"><span class="type false" style="color:#EAB766">false</span></span></span></div>  <p class="para rdfs-comment">   Returns the Unicode name for a given property, as given in the Unicode database file PropertyAliases.txt.  </p>  <p class="para">   In addition, this function maps the property <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY_MASK</span></strong> to the   synthetic names &quot;gcm&quot; / &quot;General_Category_Mask&quot;. These names are not in PropertyAliases.txt.  </p>  <p class="para">   This function complements <span class="function">{@link IntlChar::getPropertyEnum()}</span>.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getpropertyname-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <span>The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</span>     <p class="para">      <strong><span>IntlChar::PROPERTY_INVALID_CODE</span></strong> should not be used.      Also, if <span class="parameter" style="color:#3A95FF">property</span> is out of range, <strong><span>false</span></strong> is returned.     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">type</span></dt>    <dd>     <p class="para">      Selector for which name to get. If out of range, <strong><span>false</span></strong> is returned.     </p>     <p class="para">      All properties have a long name. Most have a short name, but some do not. Unicode allows for additional names;      if present these will be returned by adding 1, 2, etc. to <strong><span>IntlChar::LONG_PROPERTY_NAME</span></strong>.     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getpropertyname-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the name, or <strong><span>false</span></strong> if either the <span class="parameter" style="color:#3A95FF">property</span> or the <span class="parameter" style="color:#3A95FF">type</span>   is out of range.  </p>  <p class="para">   If a given <span class="parameter" style="color:#3A95FF">type</span> returns <strong><span>false</span></strong>, then all larger values of   <span class="parameter" style="color:#3A95FF">type</span> will return <strong><span>false</span></strong>, with one exception: if <strong><span>false</span></strong> is returned for   <strong><span>IntlChar::SHORT_PROPERTY_NAME</span></strong>, then <strong><span>IntlChar::LONG_PROPERTY_NAME</span></strong>   (and higher) may still return a non-<strong><span>false</span></strong> value.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getpropertyname-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">SHORT_PROPERTY_NAME</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">LONG_PROPERTY_NAME</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">LONG_PROPERTY_NAME </span><span style="color: #007700">+ </span><span style="color: #9876AA">1</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(10) &quot;Bidi_Class&quot;<br>string(2) &quot;bc&quot;<br>string(10) &quot;Bidi_Class&quot;<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getpropertyname-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::getPropertyEnum()} - Get the property constant value for a given property name</span></li>   </ul>  </span> </div></div>
     * @return string|false <p>*/
    public static function getPropertyName(
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $type = IntlChar::LONG_PROPERTY_NAME
    ): string|false {}

/**
*<div id="intlchar.getpropertyvalueenum" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getPropertyValueEnum</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getPropertyValueEnum</span> &mdash; <span class="dc-title">Get the property value for a given value name</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getpropertyvalueenum-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getPropertyValueEnum</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">string</span> <span class="parameter" style="color:#3A95FF">$name</span></span>): <span class="type" style="color:#EAB766">int</span></div>  <p class="para rdfs-comment">   Returns the property value integer for a given value name, as specified in the Unicode database file PropertyValueAliases.txt.   Short, long, and any other variants are recognized.  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    Some of the names in PropertyValueAliases.txt will only be recognized with    <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY_MASK</span></strong>, not    <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY</span></strong>.    These include:    <ul class="simplelist">     <li class="member">&quot;C&quot; / &quot;Other&quot;</li>     <li class="member">&quot;L&quot; / &quot;Letter&quot;</li>     <li class="member">&quot;LC&quot; / &quot;Cased_Letter&quot;</li>     <li class="member">&quot;M&quot; / &quot;Mark&quot;</li>     <li class="member">&quot;N&quot; / &quot;Number&quot;</li>     <li class="member">&quot;P&quot; / &quot;Punctuation&quot;</li>     <li class="member">&quot;S&quot; / &quot;Symbol&quot;</li>     <li class="member"> &quot;Z&quot; / &quot;Separator&quot;</li>    </ul>   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getpropertyvalueenum-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <span>The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</span>     <p class="para">      If out of range, or this method doesn&#039;t work with the given value,      <strong><span>IntlChar::PROPERTY_INVALID_CODE</span></strong> is returned.     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">name</span></dt>    <dd>     <p class="para">      The value name to be matched.  The name is compared using &quot;loose matching&quot; as described in PropertyValueAliases.txt.     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getpropertyvalueenum-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the corresponding value integer, or <strong><span>IntlChar::PROPERTY_INVALID_CODE</span></strong> if the given name   does not match any value of the given property, or if the property is invalid.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getpropertyvalueenum-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueEnum</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">, </span><span style="color: #DD0000">'greek'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueEnum</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">, </span><span style="color: #DD0000">'RIGHT_TO_LEFT'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">CHAR_DIRECTION_RIGHT_TO_LEFT</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueEnum</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BIDI_CLASS</span><span style="color: #007700">, </span><span style="color: #DD0000">'some made-up string'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_INVALID_CODE</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueEnum</span><span style="color: #007700">(</span><span style="color: #9876AA">123456789</span><span style="color: #007700">, </span><span style="color: #DD0000">'RIGHT_TO_LEFT'</span><span style="color: #007700">) === </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_INVALID_CODE</span><span style="color: #007700">);<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div></div>
     * @return int Returns the corresponding value integer, or IntlChar::PROPERTY_INVALID_CODE if the given name does not match any value of the given property, or if the property is invalid.*/
    public static function getPropertyValueEnum(
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property,
        #[LanguageLevelTypeAware(['8.0' => 'string'], default: '')] $name
    ): int {}

/**
*<div id="intlchar.getpropertyvaluename" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getPropertyValueName</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getPropertyValueName</span> &mdash; <span class="dc-title">Get the Unicode name for a property value</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getpropertyvaluename-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getPropertyValueName</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$property</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$value</span></span>, <span class="methodparam"><span class="type" style="color:#EAB766">int</span> <span class="parameter" style="color:#3A95FF">$type</span><span class="initializer"> = IntlChar::LONG_PROPERTY_NAME</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">string</span>|<span class="type" style="color:#EAB766"><span class="type false" style="color:#EAB766">false</span></span></span></div>  <p class="para rdfs-comment">   Returns the Unicode name for a given property value, as given in the Unicode database file PropertyValueAliases.txt.  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    Some of the names in PropertyValueAliases.txt can only be retrieved using    <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY_MASK</span></strong>, not    <strong><span>IntlChar::PROPERTY_GENERAL_CATEGORY</span></strong>.    These include:    <ul class="simplelist">     <li class="member">&quot;C&quot; / &quot;Other&quot;</li>     <li class="member">&quot;L&quot; / &quot;Letter&quot;</li>     <li class="member">&quot;LC&quot; / &quot;Cased_Letter&quot;</li>     <li class="member">&quot;M&quot; / &quot;Mark&quot;</li>     <li class="member">&quot;N&quot; / &quot;Number&quot;</li>     <li class="member">&quot;P&quot; / &quot;Punctuation&quot;</li>     <li class="member">&quot;S&quot; / &quot;Symbol&quot;</li>     <li class="member"> &quot;Z&quot; / &quot;Separator&quot;</li>    </ul>   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getpropertyvaluename-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">property</span></dt>    <dd>     <span>The Unicode property to lookup (see the <span>IntlChar::PROPERTY_*</span> constants).</span>     <p class="para">      If out of range, or this method doesn&#039;t work with the given value, <strong><span>false</span></strong> is returned.     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">value</span></dt>    <dd>     <p class="para">      Selector for a value for the given property. If out of range, <strong><span>false</span></strong> is returned.     </p>     <p class="para">      In general, valid values range from <span>0</span> up to some maximum. There are a couple exceptions:      <ul class="simplelist">       <li class="member">        <strong><span>IntlChar::PROPERTY_BLOCK</span></strong> values begin at the non-zero value <strong><span>IntlChar::BLOCK_CODE_BASIC_LATIN</span></strong>       </li>       <li class="member">        <strong><span>IntlChar::PROPERTY_CANONICAL_COMBINING_CLASS</span></strong> values are not contiguous and range from 0..240.       </li>      </ul>     </p>    </dd>          <dt><span class="parameter" style="color:#3A95FF">type</span></dt>    <dd>     <p class="para">      Selector for which name to get. If out of range, <strong><span>false</span></strong> is returned.     </p>     <p class="para">      All values have a long name. Most have a short name, but some do not. Unicode allows for additional names;      if present these will be returned by adding 1, 2, etc. to <strong><span>IntlChar::LONG_PROPERTY_NAME</span></strong>.     </p>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getpropertyvaluename-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns the name, or <strong><span>false</span></strong> if either the <span class="parameter" style="color:#3A95FF">property</span> or the <span class="parameter" style="color:#3A95FF">type</span>   is out of range. Returns <strong><span>null</span></strong> on failure.  </p>  <p class="para">   If a given <span class="parameter" style="color:#3A95FF">type</span> returns <strong><span>false</span></strong>, then all larger values of <span class="parameter" style="color:#3A95FF">type</span>   will return <strong><span>false</span></strong>, with one exception: if <strong><span>false</span></strong> is returned for <strong><span>IntlChar::SHORT_PROPERTY_NAME</span></strong>,   then <strong><span>IntlChar::LONG_PROPERTY_NAME</span></strong> (and higher) may still return a non-<strong><span>false</span></strong> value.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getpropertyvaluename-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">SHORT_PROPERTY_NAME</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">LONG_PROPERTY_NAME</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getPropertyValueName</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">PROPERTY_BLOCK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">BLOCK_CODE_GREEK</span><span style="color: #007700">, </span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">LONG_PROPERTY_NAME </span><span style="color: #007700">+ </span><span style="color: #9876AA">1</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(16) &quot;Greek_And_Coptic&quot;<br>string(5) &quot;Greek&quot;<br>string(16) &quot;Greek_And_Coptic&quot;<br>bool(false)<br></span></div>   </div>  </div> </div></div>
     * @return  string|false Returns the name, or FALSE if either the property or the nameChoice is out of range.*/
    public static function getPropertyValueName(
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $property,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $value,
        #[LanguageLevelTypeAware(['8.0' => 'int'], default: '')] $type = IntlChar::LONG_PROPERTY_NAME
    ): string|false {}

/**
*<div id="intlchar.getunicodeversion" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::getUnicodeVersion</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::getUnicodeVersion</span> &mdash; <span class="dc-title">Get the Unicode version</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.getunicodeversion-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::getUnicodeVersion</strong></span>(): <span class="type" style="color:#EAB766">array</span></div>  <p class="para rdfs-comment">   Gets the Unicode version information.  </p>  <p class="para">   The version array is filled in with the version information for the Unicode standard that is currently used by ICU.   For example, Unicode version 3.1.1 is represented as an array with the values <span>[3, 1, 1, 0]</span>.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.getunicodeversion-parameters">  <h3 class="title">参数</h3>  <span>此函数没有参数。</span> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.getunicodeversion-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   An array containing the Unicode version number.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.getunicodeversion-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different properties</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">getUnicodeVersion</span><span style="color: #007700">());<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>array(4) {<br>  [0]=&gt;<br>  int(7)<br>  [1]=&gt;<br>  int(0)<br>  [2]=&gt;<br>  int(0)<br>  [3]=&gt;<br>  int(0)<br>}<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.getunicodeversion-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::charAge()} - Get the &quot;age&quot; of the code point</span></li>   </ul>  </span> </div></div>
     * @return array An array containing the Unicode version number.*/
    public static function getUnicodeVersion(): array {}

/**
*<div id="intlchar.isalnum" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isalnum</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isalnum</span> &mdash; <span class="dc-title">Check if code point is an alphanumeric character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isalnum-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isalnum</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is an alphanumeric character (letter or digit).  <strong><span>true</span></strong> for characters with general categories &quot;L&quot; (letters) and &quot;Nd&quot; (decimal digit numbers).  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isalnum-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isalnum-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is an alphanumeric character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isalnum-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalnum</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalnum</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalnum</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isalnum-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isalpha()} - Check if code point is a letter character</span></li>    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>    <li class="member"><span class="function">{@link ctype_alnum()} - 检测字母数字式字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is an alphanumeric character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isalnum(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isalpha" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isalpha</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isalpha</span> &mdash; <span class="dc-title">Check if code point is a letter character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isalpha-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isalpha</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a letter character.  <strong><span>true</span></strong> for general categories &quot;L&quot; (letters).  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isalpha-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isalpha-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a letter character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isalpha-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalpha</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalpha</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isalpha</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(false)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isalpha-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isalnum()} - Check if code point is an alphanumeric character</span></li>    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>    <li class="member"><span class="function">{@link ctype_alpha()} - 检测字母字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a letter character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isalpha(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isbase" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isbase</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isbase</span> &mdash; <span class="dc-title">Check if code point is a base character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isbase-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isbase</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a base character.  <strong><span>true</span></strong> for general categories &quot;L&quot; (letters),   &quot;N&quot; (numbers), &quot;Mc&quot; (spacing combining marks), and &quot;Me&quot; (enclosing marks).  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    This is different from the Unicode definition in chapter 3.5, conformance clause D13, which defines base characters    to be all characters (not Cn) that do not graphically combine with preceding characters (M) and that are neither    control (Cc) or format (Cf) characters.   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isbase-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isbase-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a base character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isbase-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isbase</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isbase</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isbase</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isbase-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isalpha()} - Check if code point is a letter character</span></li>    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a base character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isbase(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isblank" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isblank</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isblank</span> &mdash; <span class="dc-title">Check if code point is a &quot;blank&quot; or &quot;horizontal space&quot; character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isblank-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isblank</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a &quot;blank&quot; or &quot;horizontal space&quot;, a character that visibly separates words on a line.  </p>  <p class="para">   The following are equivalent definitions:   <ul class="simplelist">    <li class="member">     <strong><span>true</span></strong> for Unicode White_Space characters except for &quot;vertical space controls&quot; where &quot;vertical space controls&quot; are     the following characters: U+000A (LF) U+000B (VT) U+000C (FF) U+000D (CR) U+0085 (NEL) U+2028 (LS) U+2029 (PS)    </li>    <li class="member">     <strong><span>true</span></strong> for U+0009 (TAB) and characters with general category &quot;Zs&quot; (space separators) except Zero Width Space (ZWSP, U+200B).    </li>   </ul>  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isblank-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isblank-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is either a &quot;blank&quot; or &quot;horizontal space&quot; character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isblank-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isblank</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isblank</span><span style="color: #007700">(</span><span style="color: #DD0000">" "</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isblank</span><span style="color: #007700">(</span><span style="color: #DD0000">"\t"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(false)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isblank-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isspace()} - Check if code point is a space character</span></li>    <li class="member"><span class="function">{@link IntlChar::isJavaSpaceChar()} - Check if code point is a space character according to Java</span></li>    <li class="member"><span class="function">{@link IntlChar::isUWhiteSpace()} - Check if code point has the White_Space Unicode property</span></li>    <li class="member"><span class="function">{@link IntlChar::isWhitespace()} - Check if code point is a whitespace character according to ICU</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is either a "blank" or "horizontal space" character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isblank(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.iscntrl" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::iscntrl</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::iscntrl</span> &mdash; <span class="dc-title">Check if code point is a control character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.iscntrl-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::iscntrl</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a control character.  </p>  <p class="para">   A control character is one of the following:   <ul class="simplelist">    <li class="member">ISO 8-bit control character (U+0000..U+001f and U+007f..U+009f)</li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_CONTROL_CHAR</span></strong> (Cc)</li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_FORMAT_CHAR</span></strong> (Cf)</li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_LINE_SEPARATOR</span></strong> (Zl)</li>    <li class="member"><strong><span>IntlChar::CHAR_CATEGORY_PARAGRAPH_SEPARATOR</span></strong> (Zp)</li>   </ul>  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.iscntrl-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.iscntrl-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a control character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.iscntrl-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">iscntrl</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">iscntrl</span><span style="color: #007700">(</span><span style="color: #DD0000">" "</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">iscntrl</span><span style="color: #007700">(</span><span style="color: #DD0000">"\n"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">iscntrl</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{200e}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(false)<br>bool(false)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.iscntrl-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isprint()} - Check if code point is a printable character</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_DEFAULT_IGNORABLE_CODE_POINT</span></strong></li>    <li class="member"><span class="function">{@link ctype_cntrl()} - 检测控制字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a control character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function iscntrl(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isdefined" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isdefined</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isdefined</span> &mdash; <span class="dc-title">Check whether the code point is defined</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isdefined-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isdefined</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is &quot;defined&quot;, which usually means that it is assigned a character.  </p>  <p class="para">   <strong><span>true</span></strong> for general categories other than &quot;Cn&quot; (other, not assigned).  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    Note that non-character code points (e.g., U+FDD0) are not &quot;defined&quot; (they are Cn), but surrogate code points are &quot;defined&quot; (Cs).   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isdefined-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isdefined-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a defined character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isdefined-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdefined</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdefined</span><span style="color: #007700">(</span><span style="color: #DD0000">" "</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdefined</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{FDD0}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isdefined-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isdigit()} - Check if code point is a digit character</span></li>    <li class="member"><span class="function">{@link IntlChar::isalpha()} - Check if code point is a letter character</span></li>    <li class="member"><span class="function">{@link IntlChar::isalnum()} - Check if code point is an alphanumeric character</span></li>    <li class="member"><span class="function">{@link IntlChar::isupper()} - Check if code point has the general category &quot;Lu&quot; (uppercase letter)</span></li>    <li class="member"><span class="function">{@link IntlChar::islower()} - Check if code point is a lowercase letter</span></li>    <li class="member"><span class="function">{@link IntlChar::istitle()} - Check if code point is a titlecase letter</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a defined character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isdefined(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isdigit" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isdigit</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isdigit</span> &mdash; <span class="dc-title">Check if code point is a digit character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isdigit-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isdigit</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a digit character.  </p>  <p class="para">   <strong><span>true</span></strong> for characters with general category &quot;Nd&quot; (decimal digit numbers). Beginning with Unicode 4, this is the same as testing for the Numeric_Type of Decimal.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isdigit-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isdigit-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a digit character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isdigit-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdigit</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdigit</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isdigit</span><span style="color: #007700">(</span><span style="color: #DD0000">"\t"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(false)<br>bool(true)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isdigit-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isalpha()} - Check if code point is a letter character</span></li>    <li class="member"><span class="function">{@link IntlChar::isalnum()} - Check if code point is an alphanumeric character</span></li>    <li class="member"><span class="function">{@link IntlChar::isxdigit()} - Check if code point is a hexadecimal digit</span></li>    <li class="member"><span class="function">{@link ctype_digit()} - 检测数字字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a digit character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isdigit(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

/**
*<div id="intlchar.isgraph" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isgraph</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isgraph</span> &mdash; <span class="dc-title">Check if code point is a graphic character</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isgraph-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isgraph</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point is a &quot;graphic&quot; character (printable, excluding spaces).  </p>  <p class="para">   <strong><span>true</span></strong> for all characters except those with general categories &quot;Cc&quot; (control codes), &quot;Cf&quot; (format controls), &quot;Cs&quot; (surrogates), &quot;Cn&quot; (unassigned), and &quot;Z&quot; (separators).  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isgraph-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isgraph-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a &quot;graphic&quot; character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isgraph-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isgraph</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isgraph</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isgraph</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{2603}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isgraph</span><span style="color: #007700">(</span><span style="color: #DD0000">"\n"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(true)<br>bool(true)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isgraph-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link ctype_graph()} - 检测除空格外的任何打印字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a "graphic" character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
