"title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is a space character, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isspace-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isspace</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isspace</span><span style="color: #007700">(</span><span style="color: #DD0000">" "</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isspace</span><span style="color: #007700">(</span><span style="color: #DD0000">"\n"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isspace</span><span style="color: #007700">(</span><span style="color: #DD0000">"\t"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isspace</span><span style="color: #007700">(</span><span style="color: #DD0000">"\u{00A0}"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(false)<br>bool(true)<br>bool(true)<br>bool(true)<br>bool(true)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isspace-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::isJavaSpaceChar()} - Check if code point is a space character according to Java</span></li>    <li class="member"><span class="function">{@link IntlChar::isWhitespace()} - Check if code point is a whitespace character according to ICU</span></li>    <li class="member"><span class="function">{@link IntlChar::isUWhiteSpace()} - Check if code point has the White_Space Unicode property</span></li>    <li class="member"><span class="function">{@link ctype_space()} - 检测空白字符</span></li>   </ul>  </span> </div></div>
     * @return bool|null Returns TRUE if codepoint is a space character, FALSE if not, NULL if <em>codepoint</em> is out of bound.*/
    public static function isspace(#[LanguageLevelTypeAware(['8.0' => 'int|string'], default: '')] $codepoint): ?bool {}

