*<div id="intlchar.isupper" class="refentry"> <div class="refnamediv">  <h1 class="refname">IntlChar::isupper</h1>  <p class="verinfo">(PHP 7, PHP 8)</p><p class="refpurpose"><span class="refname">IntlChar::isupper</span> &mdash; <span class="dc-title">Check if code point has the general category &quot;Lu&quot; (uppercase letter)</span></p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 description" id="refsect1-intlchar.isupper-description">  <h3 class="title">说明</h3>  <div class="methodsynopsis dc-description">   <span class="modifier">public</span> <span class="modifier">static</span> <span class="methodname" style="color:#CC7832"><strong>IntlChar::isupper</strong></span>(<span class="methodparam"><span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">int</span>|<span class="type" style="color:#EAB766">string</span></span> <span class="parameter" style="color:#3A95FF">$codepoint</span></span>): <span class="type" style="color:#EAB766"><span class="type" style="color:#EAB766">?</span><span class="type" style="color:#EAB766">bool</span></span></div>  <p class="para rdfs-comment">   Determines whether the specified code point has the general category &quot;Lu&quot; (uppercase letter).  </p>  <blockquote class="note" style="border:1px gray solid"><p><strong class="note" style="border:1px gray solid">注意</strong>:    <p class="para">    This misses some characters that are also uppercase but have a different general category value. In order to include those, use <span class="function">{@link IntlChar::isUUppercase()}</span>.   </p>  </p></blockquote> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 parameters" id="refsect1-intlchar.isupper-parameters">  <h3 class="title">参数</h3>  <dl>       <dt><span class="parameter" style="color:#3A95FF">codepoint</span></dt>    <dd>     <span>The <span class="type" style="color:#EAB766">int</span> codepoint value (e.g. <span>0x2603</span> for <em>U+2603 SNOWMAN</em>), or the character encoded as a UTF-8 <span class="type" style="color:#EAB766">string</span> (e.g. <span>&quot;\u{2603}&quot;</span>)</span>    </dd>     </dl> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 returnvalues" id="refsect1-intlchar.isupper-returnvalues">  <h3 class="title">返回值</h3>  <p class="para">   Returns <strong><span>true</span></strong> if   <span class="parameter" style="color:#3A95FF">codepoint</span> is an Lu uppercase letter, <strong><span>false</span></strong> if not. Returns <strong><span>null</span></strong> on failure.  </p> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 examples" id="refsect1-intlchar.isupper-examples">  <h3 class="title">示例</h3>  <div class="example" id="">   <p><strong>示例 #1 Testing different code points</strong></p>   <div class="example-contents">    <div class="phpcode" style="border-color:gray;background:#232525"><span><span style="color: #000000"><span style="color: #9876AA">&lt;?php<br />var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isupper</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isupper</span><span style="color: #007700">(</span><span style="color: #DD0000">"a"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isupper</span><span style="color: #007700">(</span><span style="color: #DD0000">"Φ"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isupper</span><span style="color: #007700">(</span><span style="color: #DD0000">"φ"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">isupper</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>bool(true)<br>bool(false)<br>bool(true)<br>bool(false)<br>bool(false)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.isupper-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::islower()} - Check if code point is a lowercase letter</span></li>    <li class="member"><span class="function">{@link IntlChar::istitle()} - Check if code point is a titlecase letter</span></li>    <li class="member"><span class="function">{@link IntlChar::tolower()} - Make Unicode character lowercase</span></li>    <li class="member"><span class="function">{@link IntlChar::toupper()} - Make Unicode character uppercase</span></li>    <li class="member"><strong><span>IntlChar::PROPERTY_UPPERCASE</span></strong></li>    <li class="member"><span class="function">{@link ctype_upper()} - 检测大写字符</span></li>   </ul>  </span> </div></div>
