<span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">totitle</span><span style="color: #007700">(</span><span style="color: #DD0000">"φ"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">totitle</span><span style="color: #007700">(</span><span style="color: #DD0000">"1"</span><span style="color: #007700">));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">totitle</span><span style="color: #007700">(</span><span style="color: #9876AA">ord</span><span style="color: #007700">(</span><span style="color: #DD0000">"A"</span><span style="color: #007700">)));<br /></span><span style="color: #9876AA">var_dump</span><span style="color: #007700">(</span><span style="color: #9876AA">IntlChar</span><span style="color: #007700">::</span><span style="color: #9876AA">totitle</span><span style="color: #007700">(</span><span style="color: #9876AA">ord</span><span style="color: #007700">(</span><span style="color: #DD0000">"a"</span><span style="color: #007700">)));<br /></span><span style="color: #9876AA">?&gt;</span></span></span></div>   </div>   <div class="example-contents"><p>以上示例会输出：</p></div>   <div class="example-contents screen" style="color:AFB1B3;background:black;padding-left:5px;">    <div class="cdata"><span>string(1) &quot;A&quot;<br>string(1) &quot;A&quot;<br>string(2) &quot;Φ&quot;<br>string(2) &quot;Φ&quot;<br>string(1) &quot;1&quot;<br>int(65)<br>int(65)<br></span></div>   </div>  </div> </div> <br></br><div style="BORDER-TOP: gray 1px dashed; OVERFLOW: hidden; HEIGHT: 1px"></div><div class="refsect1 seealso" id="refsect1-intlchar.totitle-seealso">  <h3 class="title">参见</h3>  <span>   <ul class="simplelist">    <li class="member"><span class="function">{@link IntlChar::tolower()} - Make Unicode character lowercase</span></li>    <li class="member"><span class="function">{@link IntlChar::toupper()} - Make Unicode character uppercase</span></li>    <li class="member"><span class="function">{@link mb_convert_case()} - 对字符串进行大小写转换</span></li>   </ul>  </span> </div></div>
